import { useEffect, useState } from "react";

export const Pokemon = ({id, children})=>
{       
    const {name,setName} = useState("");
    const {url,setUrl} = useState("");

    const {number,setNumber} = useState(0);
    const {height,setHeight} = useState(0);
    const {weight,setWeight} = useState(0);

    const {types,setTypes} = useState([]);
    const {sprites,setSprites} = useState([]);
    const {abilities,setAbilities} = useState([]);


    const { data, error, isLoading } = useGetPokemonByIdQuery(id);

    useEffect( ()=>{
        if(data===undefined)
        {
            return;
        }

    },[setName, setUrl, setNumber, setHeight, setWeight, setTypes, setSprites, setAbilities, data, error, isLoading])

    //const number = (isLoading ? 0 : data.id);

    return (
        <div>
            {JSON.stringify(data)}
        </div>
    );
}

export default Pokemon;
